def find_incidence (vertex, graph):
  # Finds all of the vertices in graph that are in the connected component containing v

  x_edges = graph[0]
  y_edges = graph[1]
  d_edges = graph[2]
  incidence = []
  for j in x_edges:
    if vertex == j[0] and j[1] not in incidence:
      incidence.append(j[1])
    if vertex == j[1] and j[0] not in incidence:
      incidence.append(j[0])
    for j in y_edges:
      if vertex == j[0] and j[1] not in incidence:
        incidence.append(j[1])
      if vertex == j[1] and j[0] not in incidence:
        incidence.append(j[0])
    for j in d_edges:
      if vertex == j[0] and j[1] not in incidence:
        incidence.append(j[1])
      if vertex == j[1] and j[0] not in incidence:
        incidence.append(j[0])
  return incidence

def split(graph):
  # Returns a dictionary of the connected components of a graph with more than one vertex

  x_edges = graph[0]
  y_edges = graph[1]
  d_edges = graph[2]
  vertices = graph[3]
  d = dict()
  for i in vertices:
    d[i] = [[], [], [], []]
    d[i][3] = find_incidence(i, graph)
    d[i][3].append(i)
  for k in d:
    for edge in x_edges:
      if k == edge[0] or k == edge[1]:
        d[k][0].append(edge)
    for edge in y_edges:
      if k == edge[0] or k == edge[1]:
        d[k][1].append(edge)
    for edge in d_edges:
      if k == edge[0] or k == edge[1]:
        d[k][2].append(edge)
  keys_to_delete = []
  for j in vertices:
    for k in vertices:
      if (j != k) and (len(set(d[j][3]) & set(d[k][3])) != 0):
        d[j][0] = list(set(d[j][0]) | set(d[k][0]))
        d[j][1] = list(set(d[j][1]) | set(d[k][1]))
        d[j][2] = list(set(d[j][2]) | set(d[k][2]))
        d[j][3] = list(set(d[j][3]) | set(d[k][3]))
        d[k][3] = []
        keys_to_delete.append(k)
  for i in keys_to_delete:
    del d[i]
  return d

def readable_keys(d):
  # Replaces the dictionary keys with numbers to make the prompt in check_fiber easier to understand

  better_d = dict()
  key_list = list(d.keys())
  for key in key_list:
    key_index = key_list.index(key)
    better_d[key_index] = d[key]
  return better_d

def what_subgraph(graph):
  # Classifies each connected component as being a subgraph of one of the non q-contractible graphs, or else classifies the graph as q-contractible
  green_edges = graph[1]
  red_edges = graph[0]
  rgbigons = []

  for green in green_edges:
    for red in red_edges:
      if ((green[1] == red[0]) and (green[0] == red[1])):
        rgbigons.append([green, red])
  
  # If the connected component has exactly one red-green bigon, it is considered to be a subgraph of Y_1
  if len(rgbigons) == 1:
    return [1, 'Y1']
  
  if len(rgbigons) > 1:
    bigon1 = rgbigons[0]
    bigon2 = rgbigons[1]
    green1 = bigon1[0]
    green2 = bigon2[0]

    # If there are two connected red-green bigons, then the graph is considered to be a subgraph of W
    if ((green1[1] == green2[0]) or (green2[1] == green1[0])):
      return [0, 'W']
    
    checker = 0

    # If there is a green edge, then a red edge attached to a red-green bigon, then the graph is considered to be a subgraph of Y_1
    for green in green_edges:
      if green1[1] == green[0]:
        for red in red_edges:
          if red[0] == green[1]:
            checker = 1
            return [1, 'Y1']
    
    # Any other graph containing multiple red-green bigons is considered to be a subgraph of \beta(Y_1)
    if checker == 0:
      return [2, 'bY1']
    
  # Checks for the length-10 loop that both Y2 and Y3 have, and then decides whether the graph is a subgraph of Y_2 or Y_3
  for green in green_edges:
    if green[0][1] % 10 == 2:
      for red in red_edges:
        if red[0] == green[1]:
          for red2 in red_edges:
            if red2[0] == red[1]:
              for green2 in green_edges:
                if green2[1] == red2[1]:
                  for red3 in red_edges:
                    if red3[0] == green2[0]:
                      for green3 in green_edges:
                        if green3[1] == red3[1]:
                          for red4 in red_edges:
                            if red4[0] == green3[0]:
                              for red5 in red_edges:
                                if red5[0] == red4[1]:
                                  for green4 in green_edges:
                                    if green4[0] == red5[1]:
                                      for red6 in red_edges:
                                        if red6[1] == green4[1]:
                                          if red6[0] == green[0]:
                                            if len(green_edges) == 4:
                                              return [3, 'Y2']
                                            else:
                                              two_counter = 0
                                              for green5 in green_edges:
                                                if green5[0][1] % 10 == 2:
                                                  two_counter += 1
                                              if two_counter == 4:
                                                return [3, 'Y2']
                                              else:
                                                return [4, 'Y3']

  # Checks for the length-12 loop that Y_2 and \beta(Y_3) have. The previous block takes care of the full copies of Y_2, and any subgraphs of Y_2 containing this loop are also subgraphs of \beta(Y_3), so we choose to label it bY3
  for green in green_edges:
    if green[0][1] % 10 == 2:
      for red in red_edges:
        if red[0] == green[1]:
          for red2 in red_edges:
            if red2[0] == red[1]:
              for green2 in green_edges:
                if green2[0] == red2[1]:
                  for green3 in green_edges:
                    if green3[0] == green2[1]:
                      for red3 in red_edges:
                        if red3[0] == green3[1]:
                          for green4 in green_edges:
                            if green4[1] == red3[1]:
                              for red4 in red_edges:
                                if red4[0] == green4[0]:
                                  for red5 in red_edges:
                                    if red5[0] == red4[1]:
                                      for green5 in green_edges:
                                        if green5[1] == red5[1]:
                                          for green6 in green_edges:
                                            if green6[1] == green5[0]:
                                              for red6 in red_edges:
                                                if ((red6[1] == green6[0]) and (red6[0] == green[0])):
                                                  return [5, 'bY3']

  # Checks for the length-12 loop that Y_3 has
  for green in green_edges:
    if green[0][1] % 10 == 1:
      for red in red_edges:
        if red[1] == green[1]:
          for green2 in green_edges:
            if green2[1] == red[0]:
              for green3 in green_edges:
                if green3[1] == green2[0]:
                  for red2 in red_edges:
                    if red2[0] == green3[0]:
                      for red3 in red_edges:
                        if red3[0] == red2[1]:
                          for green4 in green_edges:
                            if green4[1] == red3[1]:
                              for red4 in red_edges:
                                if red4[0] == green4[0]:
                                  for green5 in green_edges:
                                    if green5[0] == red4[1]:
                                      for green6 in green_edges:
                                        if green6[0] == green5[1]:
                                          for red5 in red_edges:
                                            if red5[0] == green6[1]:
                                              for red6 in red_edges:
                                                if red6[0] == red5[1]:
                                                  if red6[1] == green[0]:
                                                    return [4, 'Y3']
  return [6, 'q-contractible']
                                                    
def check_fiber(graph1, graph2):
    #Performs the fiber product of graph1 and graph2 over \bar{U}, then splits the graph into a dictionary of its connected components. It then prompts the user to choose a connected component for it to draw

    new = fiber_product(graph1,graph2)
    new_split = split(new)
    just_red = 0
    sub_of_triangle = 0
    interesting_dict = dict()
    for key in new_split.keys():
        g = new_split[key]
        if (len(g[1]) == 0 and len(g[2]) == 0):
            just_red += 1
        elif len(g[0]) == 0 and len(g[1]) <= 3:
            sub_of_triangle += 1
        else:
            interesting_dict[key] = g
    final_dict = readable_keys(interesting_dict)
    print(final_dict.keys())
    key_key = input('Which key would you like to choose? ')
    special_key = int(key_key)
    print('This connected component is a subgraph of ', what_subgraph(final_dict[special_key])[1], '. There are also ', just_red, ' components that only contain red edges in this fiber product and ', sub_of_triangle, ' connected components that are subgraphs of a green-yellow triangle')
    build_F3(final_dict[special_key])
    return interesting_dict

def check_row(graph1, graph2):
  # Populates the rows of the table in the paper
  row = [0, 0, 0, 0, 0, 0, 0]
  new = fiber_product(graph1,graph2)
  new_split = split(new)
  just_red = 0
  sub_of_triangle = 0
  interesting_list = []

  for key in new_split.keys():
    g = new_split[key]
    if (len(g[1]) == 0 and len(g[2]) == 0):
      just_red += 1
    elif len(g[0]) == 0 and len(g[1]) <= 3:
      sub_of_triangle += 1
    else:
      interesting_list.append(g)

  for component in interesting_list:
    info = what_subgraph(component)
    index = info[0]
    row[index] += 1

  row[6] += just_red + sub_of_triangle
  return row
  
